webpackJsonp([0x7e15710afe11],{3964:function(a,e){a.exports={data:{markdownRemark:{html:'<p>大変お待たせしました、告知が遅れてすみません。2006年の<a href="http://www.reitaisai.com/">第三回博麗神社例大祭</a>にて<a href="/!/thC/">東方夢終劇 ～ Concealed the Conclusion</a>のプレ体験版を頒布します。前半3ステージ×2くらい入ってます。 なお頒布場所は<a href="http://www.geocities.jp/nip_sigurem/">N.I.P</a>(と-16b)さん及び<a href="http://nyagakiya.sakura.ne.jp/">KMAP -KUMAHACHAA PROJET-</a>(ぬ-07b)さんのブースでの<em>委託頒布</em>となりますのでご注意ください。(danmaqは残念ながら落選しております……まぁそれだけ厳正な抽選だった、ってことでorz)  また、今回プレ体験版のため<em>余り多くの頒布数は用意しておりません</em>ので、完売の際はなにとぞご容赦ください。 (詳細は後日<a href="/!/thC/">東方夢終劇</a>のページにも掲載しておきます。プロバイダ側のDHCP鯖がずーっと死んでてやむを得ず漫画喫茶からの更新だったり \'Ａ｀) あと<a href="emeditor-danmakufu">EmEditor用東方弾幕風構文ファイル</a>を更新、今回はバグ修正のみです。</p>\n<h2>幻視力</h2>\n<p>時々、俺そろそろ末期なんじゃね？とか思うわけですよ。たとえばね…… まがるストローがまじかるストローに見えた瞬間とか(←</p>\n<h2>(拍)拍手レスしないの？</h2>\n<p>って感じのメッセージが長期にわたり結構あったので今日から突然Web拍手レスしてみるテスト。</p>\n<h2>(拍)例大祭落選オメ！！１！</h2>\n<p>負けないお(^ω^) 委託先も何とか大丈夫そうだし頒布できそうですね。</p>\n<h2>(拍)就職オメ！！１！</h2>\n<p>忙しくて死ねるお(^ωT)</p>',frontmatter:{cover:null,date:"2006-05-09T20:00:00+09:00",strDate:"2006/5/9",title:"例大祭頒布情報"}}},pathContext:{path:"/ja/blog/2006/05/09-例大祭頒布情報/",langKey:"ja"}}}});
